import React, { Component } from "react";
import "./css/App.css";

class Game extends Component{
    constructor(props){
        super(props);
        this.state={
            score:0,
            name:props.name,
            data:[[1,2,3],[4,5,6]]
        }
    }

    componentDidMount() {
        fetch('http://localhost:3001/api/getScore')
            .then(result => result.json())
            .then(res => this.setState({score:res.score}))
    }
    render(){
        const score=this.state.score;
        const data= this.state.data;
        return (<div>
        <h1> {score}</h1>
        <table>
           
           
          {data.length <= 0
            ? "NO DB ENTRIES YET"
            : data.map(dat => (
                <tr>
                dat.forEach((elem) =>{
                    <th style={{ padding: "10px" }} >{elem}</th>
                });
        
                
                //});
               
                </tr>
              ))}

         
           
        </table>
    
        </div>);

    }
} 
export default Game;
